To use open csv in Java, you will need to follow these steps:

1. Add OpenCSV dependency to your project: 
   ```
   <dependency>
       <groupId>com.opencsv</groupId>
       <artifactId>opencsv</artifactId>
       <version>5.3</version>
   </dependency>
   ```
2. Import the required classes:
   ```java
   import com.opencsv.CSVReader;
   import com.opencsv.CSVReaderBuilder;
   import com.opencsv.exceptions.CsvException;
   import java.io.FileReader;
   import java.io.IOException;
   import java.util.List;
   ```
3. Create an instance of CSVReaderBuilder:
   ```java
   CSVReader csvReader = new CSVReaderBuilder(new FileReader("path/to/csv/file"))
           .withSkipLines(1) // Skip header row
           .build();
   ```
4. Read CSV data using csvReader:
   ```java
   List<String[]> allData = csvReader.readAll();
   for (String[] row : allData) {
       System.out.println(Arrays.toString(row));
   }
   ```
   This will print the data in CSV file row by row.

Note: Please make sure to include try-catch or throws clause for IO and CsvException.

